    false,nt"url": null,nt"notes": "Mollusk, leeches (Hirudinea), and amphibian
    distribution are described for Tule Valley and adjacent Snake Valley and Fish Springs
    Flat, Tule Valley aquatic resources are described with respect to temperature, conductivity,
    and pH and compared to these adjacent areas. The spotted frog, Rana pretiosa, life
    history is described in Tule Valley in relation to the aquatic parameters. Changes
    in plant distribution through one wet cycle is noted, The lack of mollusk and fish
    in Tule Valley is explained by the salinization of the valley and the lack of permanent
    fresh water during the desiccation of the region some 13,750 years ago, Successful
    passive transport of mollusks from Snake Valley and Fish Springs Flat has not occurred
    during this time. The spotted frog and several leech species survive in Tule Valley
    because of the presence of continuous suitable habitat of seasonal waters and subsurface
    wetlands since the presence of Lake Bonneville. Likewise the spotted frog and leech
    species would have been associated with Lake Bonneville.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
